import React, { useState } from "react";
import Card from "./Card";
import data from "../data.json";

function NewCard() {

    const [active, setActive] = useState(" ");

    return(

        <div className="new-app">

            <nav>
                <button>One</button>
                <button>Two</button>
                <button>Three</button>
            </nav>

            <div>
                <Card title="1" />
                <Card title="2" />
                <Card title="3" />
            </div>
        </div>
    );
}

export default NewCard;
